import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Parse from 'parse';

const Admin = () => {
  const [isAdmin, setIsAdmin] = useState(false);
  const [adminPass, setAdminPass] = useState('');
  const [courseId, setCourseId] = useState('linux');
  const [formData, setFormData] = useState({ instructor: '', zoomLink: '', videoLink: '', schedule: '' });

  // Tabs State: 'pending' or 'approved'
  const [activeTab, setActiveTab] = useState('pending');
  const [enrollments, setEnrollments] = useState([]);
  const [loadingEnroll, setLoadingEnroll] = useState(false);

  const checkPass = () => {
    if (adminPass === "snx_admin_2026") setIsAdmin(true);
    else alert("Wrong Password!");
  };

  // စာရင်းဆွဲထုတ်တဲ့ Function (Tab ပေါ်မူတည်ပြီး status ပြောင်းစစ်မယ်)
  const fetchEnrollments = async (statusType) => {
    setLoadingEnroll(true);
    try {
      const query = new Parse.Query("Enrollments");
      query.equalTo("status", statusType);
      query.descending("createdAt");
      const results = await query.find();
      setEnrollments(results);
    } catch (error) {
      console.error("Fetch Error:", error);
    } finally {
      setLoadingEnroll(false);
    }
  };

  useEffect(() => {
    if (isAdmin) {
      fetchEnrollments(activeTab);
    }
  }, [isAdmin, activeTab]);

  const handleApprove = async (objectId) => {
    try {
      const query = new Parse.Query("Enrollments");
      const enrollment = await query.get(objectId);
      enrollment.set("status", "approved");
      await enrollment.save();
      alert("AGENT ACTIVATED! ✅");
      fetchEnrollments('pending');
    } catch (err) {
      alert("Error: " + err.message);
    }
  };

  const handleUpdate = async (e) => {
    e.preventDefault();
    const Course = Parse.Object.extend("Classes");
    const query = new Parse.Query(Course);
    query.equalTo("courseId", courseId);
    try {
      let obj = await query.first();
      if (!obj) { alert("Class not found!"); return; }
      obj.set("instructor", formData.instructor);
      obj.set("videoLink", formData.videoLink);
      await obj.save();
      alert("Updated! ✅");
    } catch (err) { alert(err.message); }
  };

  if (!isAdmin) return (
    <div style={styles.loginOverlay}>
      <h2 style={{color: '#00ff41'}}>[ ADMIN ACCESS ]</h2>
      <input type="password" placeholder="KEY_REQUIRED" onChange={e => setAdminPass(e.target.value)} style={styles.loginInput} />
      <button onClick={checkPass} style={styles.loginBtn}>LOGIN</button>
    </div>
  );

  return (
    <div style={styles.adminBody}>
      <div style={styles.header}>
        <h1>COMMAND CENTER PANEL</h1>
        <Link to="/add-class" style={styles.addClassBtn}>+ ADD CLASS</Link>
      </div>

      <div style={styles.gridContainer}>
        {/* Left: Update Form */}
        <section style={styles.section}>
          <h3 style={{color: '#86efac'}}>MOD_CLASS_DETAILS</h3>
          <form onSubmit={handleUpdate} style={styles.form}>
            <select onChange={e => setCourseId(e.target.value)} style={styles.input}>
              <option value="linux">Linux Admin</option>
              <option value="cyber">Cyber Security</option>
              <option value="hacking">World Hacking</option>
            </select>
            <input placeholder="Instructor" onChange={e => setFormData({...formData, instructor: e.target.value})} style={styles.input} />
            <input placeholder="Video ID" onChange={e => setFormData({...formData, videoLink: e.target.value})} style={styles.input} />
            <button type="submit" style={styles.updateBtn}>UPDATE</button>
          </form>
        </section>

        {/* Right: Enrollment Tabs */}
        <section style={styles.section}>
          <div style={styles.tabHeader}>
            <button onClick={() => setActiveTab('pending')} style={activeTab === 'pending' ? styles.activeTabBtn : styles.tabBtn}>PENDING</button>
            <button onClick={() => setActiveTab('approved')} style={activeTab === 'approved' ? styles.activeTabBtn : styles.tabBtn}>APPROVED_LIST</button>
          </div>

          <div style={styles.listContainer}>
            {loadingEnroll ? (
              <p>ACCESSING FILES...</p>
            ) : enrollments.length === 0 ? (
              <p style={{color: '#444', textAlign: 'center', marginTop: '20px'}}>Empty database.</p>
            ) : (
              enrollments.map((item) => (
                <div key={item.id} style={styles.enrollCard}>
                  <div>
                    <div style={{color: '#00ff41'}}>{item.get('studentName')}</div>
                    <div style={{fontSize: '12px', color: '#8892b0'}}>{item.get('phoneNumber')}</div>
                    <div style={{fontSize: '11px', color: '#666'}}>
                      Class: {item.get('courseTitle')} | Date: {item.createdAt.toLocaleDateString()}
                    </div>
                  </div>
                  {activeTab === 'pending' && (
                    <button onClick={() => handleApprove(item.id)} style={styles.approveBtn}>APPROVE</button>
                  )}
                  {activeTab === 'approved' && (
                    <span style={{color: '#00ff41', fontSize: '12px'}}>✓ ACTIVE</span>
                  )}
                </div>
              ))
            )}
          </div>
        </section>
      </div>
    </div>
  );
};

const styles = {
  loginOverlay: { background: '#0a192f', height: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center', flexDirection: 'column', fontFamily: 'monospace' },
  loginInput: { margin: '15px', padding: '12px', background: '#112240', border: '1px solid #00ff41', color: '#00ff41', textAlign: 'center' },
  loginBtn: { background: '#00ff41', padding: '10px 30px', border: 'none', fontWeight: 'bold', cursor: 'pointer' },
  adminBody: { background: '#0a192f', minHeight: '100vh', color: '#00ff41', padding: '40px 5%', fontFamily: 'monospace' },
  header: { display: 'flex', justifyContent: 'space-between', borderBottom: '1px solid #112240', paddingBottom: '20px', marginBottom: '30px' },
  addClassBtn: { color: '#00ff41', border: '1px solid #00ff41', padding: '8px 15px', textDecoration: 'none', fontSize: '14px' },
  gridContainer: { display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(350px, 1fr))', gap: '30px' },
  section: { background: '#112240', padding: '25px', borderRadius: '10px' },
  form: { display: 'flex', flexDirection: 'column', gap: '15px' },
  input: { padding: '12px', background: '#0a192f', border: '1px solid #233554', color: '#ccd6f6' },
  updateBtn: { padding: '12px', background: '#00ff41', color: '#0a192f', border: 'none', fontWeight: 'bold', cursor: 'pointer' },

  // Tab Styles
  tabHeader: { display: 'flex', gap: '10px', marginBottom: '20px', borderBottom: '1px solid #233554', paddingBottom: '10px' },
  tabBtn: { background: 'transparent', border: 'none', color: '#444', cursor: 'pointer', fontWeight: 'bold' },
  activeTabBtn: { background: 'transparent', border: 'none', color: '#00ff41', cursor: 'pointer', fontWeight: 'bold', borderBottom: '2px solid #00ff41' },

  listContainer: { maxHeight: '500px', overflowY: 'auto' },
  enrollCard: { background: '#0a192f', padding: '15px', marginBottom: '10px', borderRadius: '6px', borderLeft: '3px solid #00ff41', display: 'flex', justifyContent: 'space-between', alignItems: 'center' },
  approveBtn: { background: '#00ff41', color: '#0a192f', border: 'none', padding: '5px 12px', borderRadius: '4px', fontWeight: 'bold', fontSize: '11px', cursor: 'pointer' }
};

export default Admin;
